SET check_function_bodies = false;

DROP SEQUENCE IF EXISTS public.albums_id_seq CASCADE;
CREATE SEQUENCE public.albums_id_seq
    START WITH 347
    INCREMENT BY 1
    NO MINVALUE
    MAXVALUE 2147483647
    CACHE 1;

DROP TABLE IF EXISTS public.albums CASCADE;
CREATE TABLE public.albums (
    id integer DEFAULT nextval('public.albums_id_seq'::regclass) NOT NULL,
    title character varying(160) NOT NULL,
    artist_id integer NOT NULL
);

DROP SEQUENCE IF EXISTS public.artists_id_seq CASCADE;
CREATE SEQUENCE public.artists_id_seq
    START WITH 275
    INCREMENT BY 1
    NO MINVALUE
    MAXVALUE 2147483647
    CACHE 1;

DROP TABLE IF EXISTS public.artists CASCADE;
CREATE TABLE public.artists (
    id integer DEFAULT nextval('public.artists_id_seq'::regclass) NOT NULL,
    name character varying(120)
);

DROP SEQUENCE IF EXISTS public.genres_id_seq CASCADE;
CREATE SEQUENCE public.genres_id_seq
    START WITH 25
    INCREMENT BY 1
    NO MINVALUE
    MAXVALUE 2147483647
    CACHE 1;

DROP TABLE IF EXISTS public.genres CASCADE;
CREATE TABLE public.genres (
    id integer DEFAULT nextval('public.genres_id_seq'::regclass) NOT NULL,
    name character varying(120)
);

DROP SEQUENCE IF EXISTS public.mediatypes_id_seq CASCADE;
CREATE SEQUENCE public.mediatypes_id_seq
    START WITH 5
