DROP SEQUENCE IF EXISTS public.tracks_id_seq CASCADE;
CREATE SEQUENCE public.tracks_id_seq
    START WITH 3503
    INCREMENT BY 1
    NO MINVALUE
    MAXVALUE 2147483647
    CACHE 1;

DROP TABLE IF EXISTS public.tracks CASCADE;
CREATE TABLE public.tracks (
    id integer DEFAULT nextval('public.tracks_id_seq'::regclass) NOT NULL,
    name character varying(200) NOT NULL,
    album_id integer,
    media_type_id integer NOT NULL,
    genre_id integer,
    composer character varying(220),
    milliseconds integer NOT NULL,
    bytes integer,
    unit_price numeric(10,2) NOT NULL
);

ALTER TABLE ONLY public.albums
    ADD CONSTRAINT pk_albums PRIMARY KEY (id);
ALTER TABLE ONLY public.artists
    ADD CONSTRAINT pk_artists PRIMARY KEY (id);
ALTER TABLE ONLY public.genres
    ADD CONSTRAINT pk_genres PRIMARY KEY (id);
ALTER TABLE ONLY public.media_types
    ADD CONSTRAINT pk_media_types PRIMARY KEY (id);
ALTER TABLE ONLY public.tracks
    ADD CONSTRAINT pk_tracks PRIMARY KEY (id);
CREATE INDEX ifk_album_artist_id ON public.albums USING btree (artist_id);
CREATE INDEX ifk_track_album_id ON public.tracks USING btree (album_id);
CREATE INDEX ifk_track_genre_id ON public.tracks USING btree (genre_id);
CREATE INDEX ifk_track_media_type_id ON public.tracks USING btree (media_type_id);
ALTER TABLE ONLY public.albums
    ADD CONSTRAINT fk_album_artist_id FOREIGN KEY (artist_id) REFERENCES public.artists(id);
ALTER TABLE ONLY public.tracks
    ADD CONSTRAINT fk_track_album_id FOREIGN KEY (album_id) REFERENCES public.albums(id);
ALTER TABLE ONLY public.tracks
    ADD CONSTRAINT fk_track_genre_id FOREIGN KEY (genre_id) REFERENCES public.genres(id);
ALTER TABLE ONLY public.tracks
    ADD CONSTRAINT fk_track_media_type_id FOREIGN KEY (media_type_id) REFERENCES public.media_types(id);







